import React from 'react';
import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { SignIn } from "./views/pages";


function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="*" element={<SignIn name="test"/>}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  )
}

export default App;
